inline const RDO *GetRDO(const void *buf) {
  return ::flatbuffers::GetRoot<RDO>(buf);
}

inline const RDO *GetSizePrefixedRDO(const void *buf) {
  return ::flatbuffers::GetSizePrefixedRoot<RDO>(buf);
}

inline const char *RDOIdentifier() {
  return "$RDO";
}

inline bool RDOBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, RDOIdentifier());
}

inline bool SizePrefixedRDOBufferHasIdentifier(const void *buf) {
  return ::flatbuffers::BufferHasIdentifier(
      buf, RDOIdentifier(), true);
}

inline bool VerifyRDOBuffer(
    ::flatbuffers::Verifier &verifier) {
  return verifier.VerifyBuffer<RDO>(RDOIdentifier());
}

inline bool VerifySizePrefixedRDOBuffer(
    ::flatbuffers::Verifier &verifier) {
  return verifier.VerifySizePrefixedBuffer<RDO>(RDOIdentifier());
}

inline void FinishRDOBuffer(
    ::flatbuffers::FlatBufferBuilder &fbb,
    ::flatbuffers::Offset<RDO> root) {
  fbb.Finish(root, RDOIdentifier());
}

inline void FinishSizePrefixedRDOBuffer(
    ::flatbuffers::FlatBufferBuilder &fbb,
    ::flatbuffers::Offset<RDO> root) {
  fbb.FinishSizePrefixed(root, RDOIdentifier());
}

